CREATE DEFINER=`root`@`localhost` FUNCTION `anti_duplicate_address`(`street_in` VARCHAR(50), `street_number_in` VARCHAR(50), `door_number_in` VARCHAR(50), `city_in` VARCHAR(100)) RETURNS bigint(11)
begin
	declare id_out INT;

declare count_address int(11);

declare id_out_defoult INT;

select
    COUNT(*)
     into
    count_address
from
    addresses
where
    street = street_in
    and street_number = street_number_in
    and door_number = door_number_in
    and city = city_in;

if count_address = 1 then
select
    id
                              into
    id_out
from
    addresses
where
    street = street_in
    and street_number = street_number_in
    and door_number = door_number_in
    and CITY = city_in;

return id_out;
else 
return 0;
end if;
end ;;
