CREATE DEFINER=`root`@`localhost` FUNCTION `anti_duplicate_user_address`(`address_in` BIGINT(20), `user_in` BIGINT(20)) RETURNS tinyint(1)
begin
declare count_in int(11);

select
    COUNT(*)
     into count_in
from
    user_addresses 
where 
    ADDRESS_ID = address_in
    and 
    USER_ID = user_in;

if count_in = 0 then
return false;
else 
    return true;
end if;
end ;;
