CREATE DEFINER=`root`@`localhost` FUNCTION `check_courier_availability`(emp_id BIGINT) RETURNS tinyint(1)
    DETERMINISTIC
BEGIN
    DECLARE result_count INT;

    SELECT COUNT(*)
    INTO result_count
    FROM employee e
    WHERE e.active = 1
      AND e.role = 'courier'
      AND e.id NOT IN (
          SELECT o.delivery_courier_id
          FROM orders o
          WHERE o.status IN (3, 4)
          AND o.delivery_courier_id IS NOT NULL
      )
      AND e.id = emp_id;

    IF result_count > 0 THEN
        RETURN TRUE;
    ELSE
        RETURN FALSE;
    END IF;
END ;;
