CREATE DEFINER=`root`@`localhost` PROCEDURE `add_quantity_to_stock`(IN `mag_id` BIGINT(20), IN `prod_id` BIGINT(20), IN `qty_in` INT(11))
begin
	declare qty int(11);

	select QUANTITY
		into qty
		from stockitem  
		where MAGAZINE_ID = mag_id
		and PRODUCT_ID = prod_id;

	update stockitem 
		set QUANTITY = qty + qty_in
		where MAGAZINE_ID = mag_id
		and PRODUCT_ID = prod_id;
end ;;
