CREATE DEFINER=`root`@`localhost` PROCEDURE `CanUseCoupon`(
    IN p_coupon_code VARCHAR(50),
    IN p_user_id BIGINT,
    IN p_order_amount DECIMAL(10, 2)
)
BEGIN
    DECLARE v_coupon_id BIGINT;
    DECLARE v_type ENUM('percent', 'amount');
    DECLARE v_value DECIMAL(10, 2);
    DECLARE v_min_purchase_amount DECIMAL(10, 2);
    DECLARE v_start_date DATE;
    DECLARE v_end_date DATE;
    DECLARE v_usage_limit_per_user_per_day INT;
    DECLARE v_today DATE;
    DECLARE v_total_usage INT;

    -- Ustawienie bieżącej daty
    SET v_today = CURDATE();

    -- Sprawdź, czy kupon istnieje
    SELECT id, type, value, min_purchase_amount, start_date, end_date, usage_limit_per_user_per_day
    INTO v_coupon_id, v_type, v_value, v_min_purchase_amount, v_start_date, v_end_date, v_usage_limit_per_user_per_day
    FROM coupons
    WHERE code = p_coupon_code;

    IF v_coupon_id IS NULL THEN
        SIGNAL SQLSTATE '45001' SET MESSAGE_TEXT = 'Kupon nie istnieje';
    END IF;

    -- Sprawdź datę ważności kuponu
    IF v_today < v_start_date OR v_today > v_end_date THEN
        SIGNAL SQLSTATE '45002' SET MESSAGE_TEXT = 'Kupon stracił ważność';
    END IF;

    -- Sprawdź minimalną kwotę zakupu
    IF p_order_amount < v_min_purchase_amount THEN
        SIGNAL SQLSTATE '45003' SET MESSAGE_TEXT = 'Niespełnione warunki';
    END IF;

    -- Sprawdź limit wykorzystania kuponu na dzień dla użytkownika
    SELECT COALESCE(SUM(usage_count), 0)
    INTO v_total_usage
    FROM coupon_usage
    WHERE coupon_id = v_coupon_id AND user_id = p_user_id;

    IF v_total_usage >= v_usage_limit_per_user_per_day THEN
        SIGNAL SQLSTATE '45004' SET MESSAGE_TEXT = 'Kupon wykorzystany';
    END IF;

    -- Sprawdź, czy istnieje już wpis dla tego kuponu i użytkownika
    IF EXISTS (SELECT 1 FROM coupon_usage WHERE coupon_id = v_coupon_id AND user_id = p_user_id) THEN
        -- Zaktualizuj wpis, ustawiając in_basket na TRUE
        UPDATE coupon_usage SET in_basket = TRUE WHERE coupon_id = v_coupon_id AND user_id = p_user_id;
    ELSE
        -- Sprawdź, czy użytkownik ma już kupon w koszyku
        IF EXISTS (SELECT 1 FROM coupon_usage WHERE user_id = p_user_id AND in_basket = TRUE) THEN
            -- Zresetuj wszystkie kupony w koszyku
            UPDATE coupon_usage SET in_basket = FALSE WHERE user_id = p_user_id AND in_basket = TRUE;
        END IF;

        -- Dodaj nowy wpis do tabeli coupon_usage bez wypełniania usage_date
        INSERT INTO coupon_usage (coupon_id, user_id, usage_count, in_basket)
        VALUES (v_coupon_id, p_user_id, 0, TRUE);
    END IF;
    
END ;;
DELIMITER ;
