CREATE DEFINER=`root`@`localhost` PROCEDURE `changeOrderStatus`(
    IN `order_id_in` BIGINT(20), 
    IN `order_status_id` INT(11), 
    IN `employee_id_in` BIGINT(20)
)
BEGIN
    DECLARE picker BIGINT(20);
    DECLARE courier BIGINT(20);
    DECLARE courier_exist BIGINT(20);
    DECLARE picker_exist BIGINT(20);
    DECLARE picker_available BOOLEAN;
    DECLARE courier_available BOOLEAN;

    -- Pobranie picker_id dla zamówienia
    SELECT o.picker_id 
    INTO picker
    FROM orders o  
    WHERE o.id = order_id_in;

    -- Pobranie delivery_courier_id dla zamówienia
    SELECT o.delivery_courier_id  
    INTO courier
    FROM orders o  
    WHERE o.id = order_id_in;

    -- Sprawdzenie dostępności pickera za pomocą funkcji przy statusie 3
    IF order_status_id = 3 THEN
        SET picker_available = check_picker_availability(employee_id_in);
        
        IF picker_available = FALSE THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Picker pikuje juz zamówienie';
        END IF;
    END IF;

    -- Sprawdzenie dostępności couriera za pomocą funkcji przy statusie 4
    IF order_status_id = 4 THEN
        SET courier_available = check_courier_availability(employee_id_in);
        
        IF courier_available = FALSE THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Kurier dostarcza już zamówienie';
        END IF;
    END IF;

    -- Przypisanie pracownika do zamówienia
    IF employee_id_in IS NOT NULL THEN
        CALL prod_app_test.set_employee_to_order(order_id_in, order_status_id, employee_id_in);
    END IF;

    -- Status 1 i 2
    IF order_status_id = 1 OR order_status_id = 2 THEN
        UPDATE orders o 
        SET o.status = order_status_id 
        WHERE o.id = order_id_in;

        UPDATE orders o
        SET o.create_order_datatime = NOW()
        WHERE o.id = order_id_in;

    -- Status 3: tylko jeśli picker jest wolny (nie ma podjętego innego zamówienia)
    ELSEIF order_status_id = 3 THEN
        SELECT COUNT(o.picker_id)  
        INTO picker_exist
        FROM orders o  
        WHERE o.id = order_id_in;

        IF picker_exist <> 0 THEN
            UPDATE orders o 
            SET o.status = order_status_id 
            WHERE o.id = order_id_in;
        END IF;

    -- Status 4: tylko jeśli courier jest wolny (nie ma podjętego innego zamówienia)
    ELSEIF order_status_id = 4 THEN
        SELECT COUNT(o.delivery_courier_id)  
        INTO courier_exist
        FROM orders o  
        WHERE o.id = order_id_in;

        IF courier_exist <> 0 THEN
            UPDATE orders o 
            SET o.status = order_status_id 
            WHERE o.id = order_id_in;
        END IF;

    -- Statusy 5-7
    ELSEIF order_status_id = 5 THEN
        UPDATE orders o 
        SET o.status = order_status_id
        WHERE o.id = order_id_in;

    ELSEIF order_status_id = 6 THEN
        UPDATE orders o 
        SET o.status = order_status_id
        WHERE o.id = order_id_in;

    ELSEIF order_status_id = 7 THEN
        UPDATE orders o 
        SET o.status = order_status_id
        WHERE o.id = order_id_in;

    END IF;
END ;;
DELIMITER ;
