CREATE DEFINER=`root`@`localhost` PROCEDURE `change_active_category`(IN `category_id_in` VARCHAR(10))
begin
declare  status            VARCHAR(10);
declare parent            VARCHAR(5);
declare check_if_parent   VARCHAR(5);

 SELECT is_active,
          parent_id
     INTO
      status,
      parent
     FROM categorytree
    WHERE id = category_id_in;

   IF parent IS NULL THEN IF status = 1 THEN
      UPDATE categorytree
         SET
         is_active = 0
       WHERE id = category_id_in;

      UPDATE categorytree
         SET
         is_active = 0
       WHERE parent_id = category_id_in;

   ELSE
      UPDATE categorytree
         SET
         is_active = 1
       WHERE id = category_id_in;

      UPDATE categorytree
         SET
         is_active = 1
       WHERE parent_id = category_id_in;

   END IF;

   END IF;

   IF parent IS NOT NULL THEN IF status = 1 THEN
      UPDATE categorytree
         SET
         is_active = 0
       WHERE id = category_id_in;

   ELSE 

      IF parent IS NULL THEN 
       UPDATE categorytree
         SET
         is_active = 1
       WHERE id = category_id_in;
      

      END IF;

      IF parent IS NOT NULL THEN
         SELECT is_active
           INTO check_if_parent
           FROM categorytree
          WHERE id = parent;

         IF check_if_parent = 1 THEN UPDATE categorytree
            SET
            is_active = 1
          WHERE id = category_id_in;

         END IF;

      END IF;

   END IF;
   END IF;

   COMMIT;

END ;;
DELIMITER ;
