CREATE DEFINER=`root`@`localhost` PROCEDURE `change_product_price`(IN `price_in` DOUBLE, IN `mag_id` BIGINT(20), IN `prod_id` BIGINT(20))
begin
	declare is_promo boolean;

select
    promo
into
    is_promo
from
    stockitem s
where
    MAGAZINE_ID = mag_id
    and PRODUCT_ID = prod_id;

if is_promo = true then
update
    stockitem
set
    price_before_promo = price_in
where
    MAGAZINE_ID = mag_id
    and PRODUCT_ID = prod_id;
else
update
    stockitem
set
    price = price_in
