CREATE DEFINER=`root`@`localhost` PROCEDURE `clear_reservations`(IN `stock_id_in` BIGINT(20), IN `qty_in` INT(11), IN `basket_id_in` BIGINT(20))
begin
        declare
            qty_get int(11);
            select
                   s.QUANTITY
            into
                   qty_get
            from
                   stockitem s
            where
                   s.ID = stock_id_in
            ;
            
            update
                   basket_items bi
            set    reserved_qty = 0
            where
                   basket_id         = basket_id_in
                   and stock_item_id = stock_id_in
            ;
            
            update
                   stockitem si
            set    RESERVED_QUANTITY = 0
            where
                   si.ID = stock_id_in
            ;
            
            update
                   stockitem si
            set    QUANTITY = qty_get + qty_in
            where
                   si.ID = stock_id_in
            ;
            
            update
                   basket b
            set    b.reserved_stock = false
            where
                   b.id = basket_id_in
            ;
        
        END ;;
