CREATE DEFINER=`root`@`localhost` PROCEDURE `minus_quantity_from_stock`(IN `mag_id` BIGINT(20), IN `prod_id` BIGINT(20), IN `qty_in` INT(11))
begin
	declare qty int(11);

	select QUANTITY
		into qty
		from stockitem  
		where MAGAZINE_ID = mag_id
		and PRODUCT_ID = prod_id;

	if qty_in > qty then
	SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'Nie można zmniejszyc ilości produktu poniżej wartości 0';
		else
			update stockitem 
			set QUANTITY = qty - qty_in
			where MAGAZINE_ID = mag_id
			and PRODUCT_ID = prod_id;
	end if;
end ;;
