CREATE DEFINER=`root`@`localhost` PROCEDURE `remove_from_basket`(IN `stock_id_in` BIGINT(20), IN `qty_in` INT(11), IN `user_id_in` BIGINT(20))
begin
    declare basket_id_in bigint(20);
    declare qty_db int(11);


    select id 
    into basket_id_in
    from basket b 
    where b.customer_id = user_id_in;


    select quantity 
    into qty_db
    from basket_items
    where stock_item_id = stock_id_in
    and 
    basket_id = basket_id_in;

    if qty_db = 1 then
    delete from basket_items
    where 
    basket_id = basket_id_in
    and
    stock_item_id = stock_id_in;
    end if;

    if qty_db = 0 then
    delete from basket_items
    where 
    basket_id = basket_id_in
    and
    stock_item_id = stock_id_in;
    end if;

    if qty_db > 1 then
        update basket_items
        set quantity = qty_db - qty_in
        where 
         basket_id = basket_id_in
        and
        stock_item_id = stock_id_in;
    end if;
END ;;
