CREATE DEFINER=`root`@`localhost` PROCEDURE `setting_promo_by_product`(IN `ds_in` BIGINT(20), IN `prod_in` BIGINT(20), IN `discount_price` DOUBLE)
begin
	declare is_promo boolean;

declare price_par double;

declare price_before double;

select
	promo
	into
	is_promo
from
	stockitem s
where 
	MAGAZINE_ID = ds_in
	and 
