	and 
	PRODUCT_ID = prod_in;

	

if price_par <= discount_price then
	SIGNAL SQLSTATE '45001'
      SET MESSAGE_TEXT = 'Cena promocyjna jest większa niż cena regularna';
     end if;

update
	stockitem
set
	price_before_promo = price_par
where 
	MAGAZINE_ID = ds_in
	and
	PRODUCT_ID = prod_in;

update
	stockitem
set
	price = discount_price
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;

update
	stockitem
set
	promo = true
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;

else
	select
	price_before_promo  
	into
	price_before
from
	stockitem s
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;

update
	stockitem
set
	price = price_before
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;

update
	stockitem
set
	price_before_promo = 0
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;

update
	stockitem
set
	promo = false
where 
	MAGAZINE_ID = ds_in
	and 
	PRODUCT_ID = prod_in;
end if;
end ;;
