CREATE DEFINER=`root`@`localhost` PROCEDURE `set_current_address`(IN `address_id_in` BIGINT(20), IN `user_id_in` BIGINT(20))
begin
	declare is_double_address int(11);
    
    call set_uncurrent_address(user_id_in);
   
  	select count(*)
  	into is_double_address 
  	from user_addresses
  	where ADDRESS_ID = address_id_in;
    
  if is_double_address = 1 then
  
  update user_addresses 
    set IS_CURRENT = true
    where 
    USER_ID = user_id_in
    and 
    ADDRESS_ID  = address_id_in;
   
   else
   update user_addresses 
    set IS_CURRENT = true
    where 
    USER_ID = user_id_in
    and 
    ADDRESS_ID  = address_id_in
   LIMIT 1;
  	
  end if;
    
END ;;
