CREATE DEFINER=`root`@`localhost` PROCEDURE `set_employee_to_order`(in `order_id_in` BIGINT(20), in `order_status_id`  INT(11), employee_id_in BIGINT(20))
begin
	
declare picker bigint(20);
declare courier bigint(20);

	if order_status_id = 3 then
	
	select count(*) 
		into picker
		from orders o  
		where o.picker_id  = employee_id_in
		and o.status in(2,3,4)
	 	or o.delivery_courier_id = employee_id_in
	 	and o.status in(2,3,4);
	
	
	if picker = 0 then
	
	
	update orders o
	set o.picker_id = employee_id_in
	where o.id = order_id_in;

	update orders o
	set o.completing_order_datatime = NOW()
	where o.id = order_id_in;

	end if;	
	end if;


if order_status_id = 4 then

select count(*)  
		into courier
		from orders o  
		where o.delivery_courier_id  = employee_id_in
		and o.status in(2,3,4);

if courier = 0 then
	
update orders o
	set o.delivery_courier_id  = employee_id_in
	where o.id = order_id_in;

	update orders o
	set o.delivering_order_datatime  = NOW()
	where o.id = order_id_in;

end if;
end if;
end ;;
