CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateCouponUsage`(
    IN p_coupon_code VARCHAR(50),
    IN p_user_id BIGINT,
    OUT p_error_code INT,
    OUT p_error_message VARCHAR(255)
)
BEGIN
    DECLARE v_coupon_id BIGINT;
    DECLARE v_usage_limit_per_user_per_day INT;
    DECLARE v_today DATE;
    DECLARE v_total_usage INT;

    -- Ustawienie wartości domyślnych dla zmiennych wyjściowych
    SET p_error_code = 0;
    SET p_error_message = '';

    -- Ustawienie bieżącej daty
    SET v_today = CURDATE();

    -- Sprawdź, czy kupon istnieje
    SELECT id, usage_limit_per_user_per_day
    INTO v_coupon_id, v_usage_limit_per_user_per_day
    FROM coupons
    WHERE code = p_coupon_code;

    IF v_coupon_id IS NULL THEN
        SET p_error_code = 1;
        SET p_error_message = 'Kupon nie istnieje';
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = p_error_message;
    END IF;

    -- Sprawdź limit wykorzystania kuponu na dzień dla użytkownika
    SELECT COALESCE(SUM(usage_count), 0)
    INTO v_total_usage
    FROM coupon_usage
    WHERE coupon_id = v_coupon_id AND user_id = p_user_id AND usage_date = v_today;

    IF v_total_usage >= v_usage_limit_per_user_per_day THEN
        SET p_error_code = 2;
        SET p_error_message = 'Kupon wykorzystany';
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = p_error_message;
    END IF;

    -- Jeśli wszystkie warunki są spełnione, zaktualizuj usage_count i usage_date
    UPDATE coupon_usage
    SET usage_count = usage_count + 1, usage_date = v_today
    WHERE coupon_id = v_coupon_id AND user_id = p_user_id;

    -- Zaktualizuj komunikat i kod błędu
    SET p_error_code = 0;
    SET p_error_message = 'Kupon został zaktualizowany';
END ;;
DELIMITER ;
