CREATE DEFINER=`root`@`localhost` PROCEDURE `update_user_data`(
    IN `user_id_in` BIGINT(20), 
    IN `email_in` VARCHAR(100), 
    IN `phone_in` VARCHAR(100),
    IN `birth_date_in` DATE,
    IN `login_in` VARCHAR(100)
)
BEGIN
    UPDATE users 
    SET 
        email = CASE 
                    WHEN email_in IS NOT NULL AND email_in <> '' THEN email_in 
                    ELSE email 
                END,
        phone = CASE 
                    WHEN phone_in IS NOT NULL AND phone_in <> '' THEN phone_in 
                    ELSE phone 
                END,
        birth_date = CASE 
                    WHEN birth_date_in IS NOT NULL THEN birth_date_in 
                    ELSE birth_date 
                END,
        login = CASE 
                    WHEN login_in IS NOT NULL AND login_in <> '' THEN login_in 
                    ELSE login 
                END
    WHERE ID = user_id_in;
END ;;
