CREATE DEFINER=`root`@`localhost` PROCEDURE `UseCoupon`(
    IN p_coupon_code VARCHAR(50),
    IN p_user_id BIGINT
)
BEGIN
    DECLARE v_coupon_id BIGINT;
    DECLARE v_start_date DATE;
    DECLARE v_end_date DATE;
    DECLARE v_today DATE;
    DECLARE v_existing_usage_count INT DEFAULT 0;

    -- Ustawienie bieżącej daty
    SET v_today = CURDATE();

    -- Sprawdź, czy kupon istnieje i jest ważny
    SELECT id, start_date, end_date
    INTO v_coupon_id, v_start_date, v_end_date
    FROM coupons
    WHERE code = p_coupon_code;

    -- Sprawdzenie czy kupon istnieje
    IF v_coupon_id IS NULL THEN
        SIGNAL SQLSTATE '45001' 
            SET MESSAGE_TEXT = 'Kupon nie istnieje';
    END IF;

    -- Sprawdzenie daty ważności kuponu
    IF v_today < v_start_date OR v_today > v_end_date THEN
        SIGNAL SQLSTATE '45002' 
            SET MESSAGE_TEXT = 'Kupon stracił ważność';
    END IF;

    -- Sprawdzenie, czy kupon został już dodany dla tego użytkownika
    SELECT COUNT(*) 
    INTO v_existing_usage_count
    FROM coupon_usage
    WHERE coupon_id = v_coupon_id AND user_id = p_user_id;

    IF v_existing_usage_count > 0 THEN
        SIGNAL SQLSTATE '45003' 
            SET MESSAGE_TEXT = 'Kupon został już dodany dla tego użytkownika';
    END IF;

    -- Dodaj wpis do tabeli coupon_usage
    INSERT INTO coupon_usage (coupon_id, user_id, usage_date, usage_count, in_basket)
    VALUES (v_coupon_id, p_user_id, v_today, 0, FALSE);

END ;;
